import React from 'react';
import './App.css';
import Person from './Person/Person';

function App() {
 return (
    <div className="App">
       <header className="App-header">
       <a className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Person />
      <Person />
      <Person />
     </div>

   );
}

export default App;
